import {useParams} from "react-router-dom";
import React, {useState} from "react";
import { Document, Page} from 'react-pdf/dist/esm/entry.webpack'
import ArticlePDF from "../articles/astrologie-fevrier-2023.pdf"

function Article() {

    const {id} = useParams()
    return(
        <Document file={ArticlePDF} pageNumber={1}>
            <Page height="600"/>
        </Document>
    )
}

export default Article;
